import React from "react";
const AdviseeTableHead = () => {
  return (
    <thead>
      <tr>
        <th>Last Name</th>
        <th>First Name</th>
        <th>Email</th>
        <th>Student ID</th>
      </tr>
    </thead>
  );
};

export default AdviseeTableHead;
